import React, { Component } from 'react';
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem } from 'reactstrap';

import "../App.css"

class NavigationBarBottom extends Component {
  constructor(props) {
    super(props);

    this.toggle = this.toggle.bind(this);
    this.state = {
      isOpen: false
    };
  }
  toggle() {
    this.setState({
      isOpen: !this.state.isOpen
    });
  }
  render() {
    return (
      <div className="navBar">
        <Navbar color="light fixed-bottom" light expand="md">
            <Nav navbar>
            <NavItem>
              <NavLink href="#"><p className="text-info"><img src={require(`../assets/candy.png`)} height="25px" alt="Card image cap" />  Snack Tadisional</p></NavLink>
            </NavItem>
              <NavItem>
                <NavLink href="#"><p className="text-danger"> <img src={require(`../assets/chips.png`)} height="25px" alt="Card image cap" /> Keripik</p></NavLink>
              </NavItem>
              <NavItem>
                <NavLink href="#"><p className="text-warning"><img src={require(`../assets/peanuts.png`)} height="25px" alt="Card image cap" /> Kacang </p></NavLink>
              </NavItem>
              <NavItem>
                <NavLink href="#"><p className="text-muted"><img src={require(`../assets/shopping-bag.png`)} height="25px" alt="Card image cap" /> Cart </p></NavLink>
              </NavItem>
                <UncontrolledDropdown nav inNavbar>
                  <DropdownToggle nav caret>
                    Options
                  </DropdownToggle>
                  <DropdownMenu right>
                    <DropdownItem>
                      <NavLink href="#"><p className="text-success"><img src={require(`../assets/wallet.png`)} height="25px" alt="Card image cap" /> Konfirmasi Pembayaran </p></NavLink>
                    </DropdownItem>
                    <DropdownItem>
                      <NavLink href="#"><p className="text-primary"><img src={require(`../assets/login-square-arrow-button-outline.png`)} height="25px" alt="Card image cap" />  Log In</p></NavLink>
                    </DropdownItem>
                    <DropdownItem>
                      <NavLink href="#"><p className="text-danger"><img src={require(`../assets/logout.png`)} height="25px" alt="Card image cap" />  Log Out</p></NavLink>
                    </DropdownItem>
                  </DropdownMenu>
                </UncontrolledDropdown>
            </Nav>
        </Navbar>
      </div>
    );
  }
}

export default NavigationBarBottom;
